import "./index.css";
import React from "react";

function About() {
  return (
    <div className="flex justify-center items-center flex-col">
      <h1 className="align-baseline">Resume</h1>
      <p>I'm Front-end developer</p>
      <p>
        Experienced Embedded C Developer transitioning to Full-Stack
        Development,<br></br>
        equipped with strong React(using redux), JavaScript, HTML, and CSS
        skills, adept at creating responsive web applications, committed to
        continuous learning and collaboration for delivering visually appealing
        user interfaces in a dynamic team environment
      </p>
    </div>
  );
}

export default About;
